import React from 'react';
import logo from '../img/logo.png'
function Header() {
  return (
    <>
    <div className='header'>
      {/* 메뉴버튼 */}
      <button></button>
      <h1>
        <img src={logo} alt='유튜브로고'/>
        Youtube
      </h1>
      <div className='inputBox'>
        <input type='text' placeholder='serch...'/>
      </div>
    </div>
    </>
  );
}

export default Header;
